import React, { Component } from "react";
export class ChildMessageRenderer extends Component {
  constructor(props) {
    super(props);
    this.invokeParentMethod = this.invokeParentMethod.bind(this);
  }
  invokeParentMethod() {}

  render() {
    return this.props.data.indicator === "Urgent" ||
      this.props.data.indicator === "URGENT" ? (
      <span>
        <button id="btnUrgent" className="btn">
          Urgent
        </button>
      </span>
    ) : this.props.data.indicator === "Medium" ||
      this.props.data.indicator === "MEDIUM" ? (
      <span>
        <button id="btnMedium" className="btn">
          Medium
        </button>
      </span>
    ) : this.props.data.indicator === "NEXT CYCLE" ||
      this.props.data.indicator === "MEDIUM" ? (
      <span>
        <button id="btnMedium" className="btn">
          Next Cycle
        </button>
      </span>
    ) : (
      <button id="btnMedium" className="btn">
        Medium
      </button>
    );
  }
}

export default ChildMessageRenderer;
